import Rush_Poster from './Rush_Poster.png'
import Rush_Background from './Rush_Background.JPG'

const Rush = () => {
    return (
        <div className="Rush">
            <img className="Rush_Background" src={Rush_Background} alt="" />
            <div className="Rush_Overlay">
                <h1>Recruitment</h1>
                <h2>Welcome to Fall 2022 Rush!</h2>
            </div>

            
            <center>
                <img className="Rush_Poster" src= {Rush_Poster} alt=""/>
            </center>
        </div>
    );
}

export default Rush;
